Fleetmatics, a Verizon Company supplies fleet management systems based on GPS. Founded in Ireland in 2004, Fleetmatics has offices in the United States, Mexico, Great Britain, Ireland, France, Germany, Poland, Portugal, Italy, and Australia and is listed on the New York (NYSE) Stock Exchange. Fleetmatics is the fastest growing provider of GPS-based vehicle tracking systems. Fleetmatics has also been based in the Netherlands since 2014.

Fleetmatics Facts:

- Save on fuel consumption;
- Increase productivity;
- Improve customer service;
- Save on personnel costs;
- Extensive reports;
- Increase the safety of your employees;
- Reduce CO2 emissions;
- Trip registration Tax Authorities (Hallmark for trip registration systems);
- Highly detailed vehicle information with our CANbus module.
